import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { GithubIcon, Globe, Clock, UserCircle2 } from 'lucide-react';
import LearnMoreButton from './LearnMoreButton';

// Simple user display component
const UserDisplay = ({ user }) => (
  <div className="flex items-center gap-2 text-sm text-gray-500">
    <UserCircle2 className="w-4 h-4" />
    <span>{typeof user === 'string' ? user : (user?.username || 'Anonymous')}</span>
  </div>
);

// ... rest of your imports and helper functions ...

const Posts = () => {
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPosts = async () => {
      try {
        const response = await fetch('/api/posts', {
          credentials: 'include'
        });
        const data = await response.json();
        setPosts(data);
      } catch (error) {
        console.error('Error fetching posts:', error);
      } finally {
        setLoading(false);
      }
    };
    fetchPosts();
  }, []);

  if (loading) return <LoadingSpinner />;

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header section remains the same */}
      <div className="max-w-4xl mx-auto px-4 py-8">
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-2xl font-bold text-gray-900">Recent Posts</h1>
          <Link 
            to="/posts/create"
            className="bg-indigo-600 text-white px-4 py-2 rounded-md hover:bg-indigo-700 transition-colors"
          >
            Create New Post
          </Link>
        </div>

        <div className="space-y-6">
          {posts.map((post) => (
            <div key={post._id} className="bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow overflow-hidden">
              <div className="p-6">
                <div className="flex justify-between items-start">
                  <div>
                    <h2 className="text-xl font-bold text-gray-900">{post.title}</h2>
                    <span className="inline-block px-2 py-1 text-sm rounded bg-gray-100 text-gray-600 mt-1">
                      {post.type}
                    </span>
                  </div>
                  {/* Using the simple UserDisplay component instead of CircleUserRound */}
                  <UserDisplay user={post.user} />
                </div>

                <p className="text-gray-700 mt-3">{post.body}</p>

                <div className="mt-4 pt-4 border-t border-gray-100">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center gap-4">
                      {post.github && (
                        <a 
                          href={post.github}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="flex items-center gap-1 text-gray-600 hover:text-gray-900"
                        >
                          <GithubIcon className="w-4 h-4" />
                          <span className="text-sm">GitHub</span>
                        </a>
                      )}
                      {post.demo && (
                        <a 
                          href={post.demo}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="flex items-center gap-1 text-gray-600 hover:text-gray-900"
                        >
                          <Globe className="w-4 h-4" />
                          <span className="text-sm">Live Demo</span>
                        </a>
                      )}
                    </div>

                    <div onClick={() => navigate(`/posts/${post._id}`)}>
                      <LearnMoreButton text="Read More" />
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Posts;
